import "./OpenSPGame.css"

export default function OpenSPGame() {
    return (
        <div className="open-game-inner-container">
            <h3 className="header">Open a Game</h3>

            <div className="entry">
                <button className="open-game-btn">
                    CREATE
                </button>
            </div>
        </div >
    )
}
